import { AppBar, Toolbar } from "@material-ui/core";

import React from "react";

export default function Header() {
  return (
    <header>
      <AppBar style={{ backgroundColor: "#00c8f7", position: "center" }}>
        <Toolbar>Snackpass popular items</Toolbar>
      </AppBar>
    </header>
  );
}
